const Navbar = (props) => {
  return (
    <nav>
      <div className="navigation">
        <a
          href={props.brandLink}
          className={props.className}
          style={props.style}
        >
          {props.brandName && <h1>{props.brandName}</h1>}
          {props.brandImage && <img src={props.logo} alt={props.brandName} />}
        </a>
      </div>
    </nav>
  );
};

export default Navbar;
